export default function NewApi() {
    const [items, setItems] = useState();

    useEffect(() => {
        fetch(`https://api.sampleapis.com/rickandmorty/characters`).then(res => res.json).then(data => console.log(data))
    },[])

    return (
        <div>
            <h1>This is the new api page</h1>
        </div>
    )
}
